import React from "react";

const AboutContent = () => {
  return (
    <div className="about">
      <div className="left">
        <h1>Who Am I</h1>
        <p>I'm a front-end developer. I create responsive secure websites.</p>
      </div>
      <div className="right"></div>
    </div>
  );
};

export default AboutContent;
